const CharactersList = ({ characters }) => {

    return (
        <ul>
            {characters.map(character => (
                <li key={character.id}>
                    <img src={character.image} alt={character.name} />
                    <p>{character.name}</p>
                    <p>{character.status} </p>
                    <p>{character.gender} </p>
                    <p>{ character.episode.len}</p>
                </li>
            ))}
        </ul>
    )

}

export default CharactersList;
